package com.codecounty.dsa.hashing;

import java.util.Arrays;
import java.util.HashMap;
import java.util.Map;

public class _242ValidAnagram {

	public static void main(String[] args) {

		String s = "";
		String t = "";
		
//		s = "ami";
//		t = "ima";
		boolean x = isAnagramOptimized(s, t);
		System.out.println(x);

	}
	
	private static boolean isAnagramOptimized(String s, String t) {
		int[] hashArray = new int[26];// 122

		
//		Time : 3n = n
//		SPace: n
		if (s.length() != t.length())
			return false;

		// 1st for loop
		for (int i = 0; i < s.length(); i++) {// i = 0 | s
			hashArray[s.charAt(i)-97]++;//a = 97
		}
		
		System.out.println(Arrays.toString(hashArray));
		// 2nd for loop
		for (int i = 0; i < t.length(); i++) {// i = 0 | s
			hashArray[t.charAt(i)-97]--;
		}
		
		// 3rd for loop
		for (int i = 0; i < hashArray.length; i++) {
			if(hashArray[i] != 0)
				return false;
		}

		return true;
		
	}

	private static boolean isAnagram(String s, String t) {

		if (s.length() != t.length())
			return false;

		HashMap<Character, Integer> sMap = new HashMap();
		HashMap<Character, Integer> tMap = new HashMap();

		for (int i = 0; i < s.length(); i++) {// frequency map
			sMap.put(s.charAt(i), sMap.getOrDefault(s.charAt(i), 0) + 1);
			tMap.put(t.charAt(i), tMap.getOrDefault(t.charAt(i), 0) + 1);
		}
		System.out.println(sMap);
		System.out.println(tMap);
		
		for (Map.Entry<Character, Integer> entry : sMap.entrySet()) {
			Character key = entry.getKey();
			Integer value = entry.getValue();
			Integer num = tMap.get(key);
			System.out.println(num+" "+value);
			if(num != value) {
				System.out.println(key );
				return false;
			}
			
		}
		
		return true;

	}
	
	

}
